import React from 'react';
import './App.css';
import Home from "./pages/home"
import Navigationbar from "./components/navigationbar";
import { Helmet } from 'react-helmet'

const title = "Alper Tunca";

function App() {
    var sectionStyle = {
        width: "100%",
        height: "400px"
    };

    return (
        <div className="App bg" style={sectionStyle}>
            <Navigationbar/>

            <Home/>
        </div>
    );
}

export default App;
